sys_variable_value.value:
(function execute(inputs, outputs) {
  var artifact_data = JSON.parse(inputs.artifact_records);

  var filtered_and_sorted_records = artifact_data.artifacts
    .filter(artifact => artifact.name === 'atat-web-ui' && 
            artifact.workflow_run.head_branch === 'develop')
    .sort((a,b) => new Date(b.created_at) - new Date(a.created_at));
  if (filtered_and_sorted_records.length > 0) {
    outputs.record_id = filtered_and_sorted_records[0].id;
    outputs.record_url = filtered_and_sorted_records[0].archive_download_url;
  } else {
    gs.error('Failed to properly retrieve latest artifacts from develop.');
  }
})(inputs, outputs);

